column8:
●五穀（はと麦、とうもろこし、発芽玄米、大豆、大麦）の香ばしさと、すっきりとした味わいが食事にもよく合います。<BR>●脂肪の分解と消費に働く酵素の活性を高める茶カテキンを豊富に含んでおり、脂肪を代謝する力を高め、エネルギーとして脂肪を消費し、体脂肪を減らすのを助けるので、体脂肪が気になる方に適しています。特定保健用食品。日本人間ドック健診協会推薦。<BR>※こちらの商品は、お届け地域によって分納・翌日以降のお届けとなる場合がございます。<br>●タイプ／機能性飲料<BR>●容器／ペットボトル<BR>●内容量／500ml（1本あたり）<BR>●原材料／茶抽出物（茶カテキン）、発芽玄米、大麦、麦芽エキス、とうもろこし、はと麦、ルイボス、大豆、環状オリゴ糖、ビタミンC、香料<BR>●表示すべきアレルギー項目／大豆<BR>●製造国／日本<BR>●原産国／日本、ケニア、カナダ、米国、タイ、南アフリカ<BR>●カロリー／25kcal<BR>●成分／たんぱく質：0g、脂質：0g、炭水化物：6.5g、ナトリウム：52mg、茶カテキン：540mg、カフェイン：15mg<BR>●カフェイン／あり<BR>●保存方法／高温、直射日光を避けてください。<BR>●特定保健用食品<BR>●1ケース＝24本<BR>※成分・カロリー・カフェインは500ml当たり<BR>※メーカー都合により、パッケージデザインおよび仕様が変更になる場合がございます。<BR>※賞味期限について：商品の発送時点で、賞味期限まで残り60日以上の商品をお届けします。<br>●メーカー／花王<br>●型番／KAO263797<br>●JANコード／4901301263797<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

